import React from "react";
import "./Operadores.css";

function Operadores() {
    return (
        <div className="contain-operadores">
            <div><button>+</button></div>
            <div><button>-</button></div>
            <div><button>x</button></div>
            <div><button>/</button></div>
            <div><button>CE</button></div>
            <div></div>
        </div>
    );
}

export { Operadores };
